import React, { useEffect, useState } from 'react';
import { API_BASE_URL } from '../apiConfig';
import './Show.css';
import { XMLParser } from 'fast-xml-parser';

interface DataItem {
  ID_pers: number;
  name: string;
  firstname: string;
  subject: string;
  comment?: string;
  month: string;
  load: number;
}

interface GroupedData {
  name: string;
  firstname: string;
  subject: string;
  comment: string;
  loads: { [key: string]: number };
}

function List_all() {
  const [data, setData] = useState<DataItem[]>([]);
  const [groupedData, setGroupedData] = useState<GroupedData[]>([]);
  const [months, setMonths] = useState<string[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [sortConfig, setSortConfig] = useState<{ key: string, direction: string } | null>(null);
  const parser = new XMLParser();

  useEffect(() => {
    fetch(`${API_BASE_URL}/api/data/xml`)
      .then((response) => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.text();
      })
      .then((xmlData) => {
        const jsonData = parser.parse(xmlData);
        const dataItems = jsonData.ListAll.DataItem.map((item: any) => ({
          ID_pers: item.ID_pers,
          name: item.name,
          firstname: item.firstname,
          subject: item.subject,
          comment: item.comment,
          month: item.month,
          load: item.load
        }));
        setData(dataItems);
        processData(dataItems);
        setLoading(false);
      })
      .catch((error) => {
        setError(error.message);
        setLoading(false);
      });
  }, []);

  const processData = (data: DataItem[]) => {
    const grouped: { [key: string]: GroupedData } = {};
    const monthsSet = new Set<string>();

    data.forEach((item) => {
      const key = `${item.name}-${item.firstname}-${item.subject}-${item.comment || 'No comment'}`;
      monthsSet.add(item.month);

      if (!grouped[key]) {
        grouped[key] = {
          name: item.name,
          firstname: item.firstname,
          subject: item.subject,
          comment: item.comment || 'No comment',
          loads: {},
        };
      }

      grouped[key].loads[item.month] = item.load;
    });

    setGroupedData(Object.values(grouped));
    setMonths(Array.from(monthsSet).sort());
  };

  const requestSort = (key: string) => {
    let direction = 'ascending';
    if (sortConfig && sortConfig.key === key && sortConfig.direction === 'ascending') {
      direction = 'descending';
    }
    setSortConfig({ key, direction });
  };

  const sortedData = React.useMemo(() => {
    if (!sortConfig) {
      return groupedData;
    }
    return [...groupedData].sort((a, b) => {
      if (sortConfig.key === 'name') {
        if (a.name < b.name) {
          return sortConfig.direction === 'ascending' ? -1 : 1;
        }
        if (a.name > b.name) {
          return sortConfig.direction === 'ascending' ? 1 : -1;
        }
      } else if (sortConfig.key === 'subject') {
        if (a.subject < b.subject) {
          return sortConfig.direction === 'ascending' ? -1 : 1;
        }
        if (a.subject > b.subject) {
          return sortConfig.direction === 'ascending' ? 1 : -1;
        }
      }
      return 0;
    });
  }, [groupedData, sortConfig]);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div>
      <h1>List All Page</h1>
      <table>
        <thead>
          <tr>
            <th onClick={() => requestSort('name')}>Name</th>
            <th>Firstname</th>
            <th onClick={() => requestSort('subject')}>Subject</th>
            <th>Comment</th>
            {months.map((month) => {
  const date = new Date(month);
  const dayStr = String(date.getDate()).padStart(2, '0');
  const monthStr = String(date.getMonth() + 1).padStart(2, '0');
  const yearStr = date.getFullYear();
  return <th key={month}>{`${dayStr}/${monthStr}/${yearStr}`}</th>;
})}
          </tr>
        </thead>
        <tbody>
          {sortedData.map((item, index) => (
            <tr key={index}>
              <td>{item.name}</td>
              <td>{item.firstname}</td>
              <td>{item.subject}</td>
              <td>{item.comment}</td>
              {months.map((month) => (
                <td key={month}>{item.loads[month] || 0}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default List_all;
